import React, {Component} from 'react';
// import {Link} from 'react-router-dom';

// import Navbar from "./modules/layouts/Navbar";
import TimerModal from '../components/TimerModal';
import Slider from '../components/Slider';
// import CommentModal from './modules/comments/components/CommentModal';

// import DateCard from './modules/card/components/DateCard';
// import Full from './modules/card/components/MainCard';

export class Enquete extends Component {

    render() {
        return (
            <div>
                <header>
                    <img src={require('../../../assets/img/logo-min.png')} alt="logo"/>
                    <div id="navbar">
                    <Navbar/>
                    </div>
                    <div id="navbarMobile">
                        <ul>
                            <ui>Audiências</ui>
                            <ui>Calendário</ui>
                            <ui>Ajuda</ui>
                            <ui>Perfil</ui>
                        </ul>
                    </div>
                </header>   

                <Navbar
                    navbarState={this.state.navbarOpen}
                    handleNavbar={this.handleNavbar}
                    />
                    <Full />         
                    <DateCard />       
                    <TimerModal />
                    <Slider />
                    <CommentModal />
            </div>
        )
   }
};

export default Enquete;
